SELECT COUNT(*) as agg_0, COUNT(*) as agg_1 FROM "L_AIRPORT_ID" LEFT OUTER JOIN "On_Time_On_Time_Performance_2016_1" ON "L_AIRPORT_ID"."Code" = "On_Time_On_Time_Performance_2016_1"."DestAirportID" LEFT OUTER JOIN "L_CITY_MARKET_ID" ON "On_Time_On_Time_Performance_2016_1"."DestCityMarketID" = "L_CITY_MARKET_ID"."Code" LEFT OUTER JOIN "L_AIRLINE_ID" ON "On_Time_On_Time_Performance_2016_1"."AirlineID" = "L_AIRLINE_ID"."Code" LEFT OUTER JOIN "L_DISTANCE_GROUP_250" ON "On_Time_On_Time_Performance_2016_1"."DistanceGroup" = "L_DISTANCE_GROUP_250"."Code"  WHERE "L_AIRLINE_ID"."Description" IN ('Northern Air Car Inc.: NC') AND "L_CITY_MARKET_ID"."Description" NOT LIKE '%Ki%ngdom%' AND "L_DISTANCE_GROUP_250"."Description" IN ('1500-1749 Miles', '1000-1249 Miles', '1750-1999 Miles') AND "L_AIRPORT_ID"."Description" IN ('Mulhouse, France: EuroAirport') AND ("L_CITY_MARKET_ID"."Description" IN ('Sealing Point, AK', 'Grass Valley, CA', 'Bonners Ferry, ID', 'Westminster, MD', 'Keyes Point, AK', 'Pittsfield, ME') OR "L_CITY_MARKET_ID"."Code" BETWEEN 44208 AND 339117 OR "L_CITY_MARKET_ID"."Description" NOT LIKE '%La%ke,%') AND ("L_DISTANCE_GROUP_250"."Description" NOT LIKE '%175%0-1999%' OR "L_DISTANCE_GROUP_250"."Description" NOT LIKE '%and%' OR "L_DISTANCE_GROUP_250"."Description" != '1250-1499 Miles')